BEGIN;
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (1, 'Climate Council', 'Climate Council', '(02) 9356 8528', 'info@climatecouncil.org.au', 'The Climate Council is the number one organisation communicating on climate change nationally, consistently holding this position since 2016. Our work in the media influences the national conversation, sets the record straight when misinformation tak', 1, '2,3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (2, 'CareFlight', 'CareFlight', '61 2 9843 5100', 'helppoint@careflight.org', 'CareFlight was founded in 1986 as an aeromedical charity with the mission to save lives, speed recovery and serve the community.  ', 1, '2,1', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (3, 'Beyond Blue', 'Beyond Blue', '(03) 9810 6100', 'help@beyondblue.org', 'Beyond Blue is an independent, not-for-profit organisation working to reduce the impact of anxiety, depression and suicide in Australia.', 1, '0,2', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (4, 'Renew', 'Renew', '61 (03) 9639 1500', 'portal@renew.org.au', 'Renew is a national, not-for-profit organisation that inspires, enables and advocates for people to live sustainably in their homes and communities. Established in 1980, Renew provides expert, independent advice on sustainable solutions for the home ', 1, '1,2', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (5, 'Cancer Council', 'Cancer Council', '03 9514 6100', 'enquiries@cancervic.org.au', 'Every year, more than 30,500 Victorians will be diagnosed with cancer, and nearly 11,000 will die from cancer. As an independent, not-for-profit organisation, we play a leading role in reducing the impact of all cancers on all people.', 1, '0,3,2', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (6, 'Pink Hope', 'Pink Hope', '02 8084 2288', 'info@pinkhope.org.au', 'Pink Hope is Australia\'s only community designed to inspire women to be proactive and vigilant with their breast and ovarian health, while providing a safe haven for high-risk women to connect.', 1, '3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (7, 'Stroke Foundation', 'Stroke Foundation', '1300 194 196', 'supporter@strokefoundation.org.au', 'We stand alongside stroke survivors and their families, healthcare professionals and researchers. We build community awareness and foster new thinking and innovative treatments.', 1, '2', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (8, 'CatRescue 901', 'CatRescue 901', 'Not provided', 'social@catrescue901.org.au', 'CatRescue 901 is committed to rescuing, caring for, and rehoming abandoned animals from council pounds and the streets. We rely on the community\'s goodwill and volunteers\' dedication to do this vital work.\n', 1, '0,1,2,3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (9, 'GIVIT', 'GIVIT', 'Not provided', 'info@givit.org.au', 'GIVIT is an online non-profit organisation matching generosity with genuine need. GIVIT connects donors and support organisations to make sure people and communities get exactly what they need, when they need it most.  ', 1, '0,1,2', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (10, 'Yalari', 'Yalari', '(07) 5665 8688', 'info@yalari.org', 'Since 2005, Yalari has been providing Indigenous children from regional, rural and remote communities across Australia the opportunity to receive full secondary boarding school scholarships.', 1, '2,3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (11, 'TreeProject', 'TreeProject', '61 3 9650 9477', 'nfo@treeproject.org', 'We’ve achieved this with a vast, passionate network of landholders and volunteer growers. We believe that all of us, rural and urban alike, have a role to play in repairing our natural environment. TreeProject makes this connection possible.', 1, '2,3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (12, 'KidsXpress', 'KidsXpress', '(02) 9380 9221', 'info@kidsxpress.org.au', 'KidsXpress provides an innovative and transformative therapy program for kids impacted by emotional trauma. Our program uniquely combines Music, Art, Drama and Play therapy in a co-leg group therapy program.', 1, '0,1,2,3', 'data:image/jpeg;base64,');
INSERT INTO `info` (`id`, `no`, `name`, `phone`, `email`, `description`, `role`, `target`, `image`) VALUES (13, 'Free to Feed', 'Free to Feed', 'Not provided', 'rebekah@freeto.org', 'Free to Feed is a not-for-profit social enterprise in awe of the potential and spirit of refugees, people seeking asylum and new migrants – and appreciative of what they want to offer as new community members – we aim to champion their unique skills ', 1, '0,2', 'data:image/jpeg;base64,');
